<p>Homebrew 由 Max Howell 创建于2009年，初衷是为了解决在 macOS 上安装软件的不便，尤其是对于开发者常用的开源工具。它迅速获得了开发者的喜爱，因为它提供了统一的命令行接口来管理软件包，解决了依赖关系管理的问题，避免了手动编译和配置的繁琐。随着时间的发展，Homebrew 不断完善，支持的软件包数量激增，社区活跃度高，成为了 macOS 用户不可或缺的工具之一。2017年，Homebrew 宣布成为一个非营利组织，进一步保障了项目的长期发展。</p>
